script: |
  super -f text -I q2805.spq | sort > q2805.out

inputs:
  - name: q2805.spq
    data: |
      SELECT ALL col1 * - col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 * col0 * + + ( - 44 ) NOT BETWEEN - col1 * 39 AND - ( + col1 ) + - col2;
  - name: tab2

outputs:
  - name: q2805.out
    data: |
      -1173
      -3080
      -3886
